import "./App.css";
import Card from "./Card";

function App() {
  return (
    <div className="App">
      <h1>Task: Add three Card elements</h1>
      <Card h2="First card's h2" h3 h2="First card's h3"/>
      <Card h2="Second card's h2" h3 h2="Second card's h3" />
      <Card h2="Third card's h2" h3 h2="Third card's h3"/>
    </div>
  );
};

export default App;
